import React, { Component } from 'react'
import { Container } from 'react-bootstrap'

export default class MyProfile extends Component {
    render() {
        return (
            <div>
                <Container>
                    <div class="d-flex justify-content-center">
                        <h1>My Profile</h1>
                    </div>
                </Container>
            </div>
        )
    }
}
